import React, { useState } from 'react';

function DeepLearning() {
  const [activeArchitecture, setActiveArchitecture] = useState('cnn');

  const architectures = {
    cnn: {
      name: 'Convolutional Neural Networks',
      description: 'Specialized neural networks for processing grid-like data, particularly effective for image analysis',
      layers: [
        'Convolutional Layer',
        'Pooling Layer',
        'ReLU Layer',
        'Fully Connected Layer',
        'Softmax Layer'
      ],
      applications: [
        'Image Classification',
        'Object Detection',
        'Face Recognition',
        'Medical Imaging'
      ],
      frameworks: [
        'TensorFlow',
        'PyTorch',
        'Keras'
      ],
      performance: {
        accuracy: '96%',
        training_time: 'Medium',
        inference_speed: 'Fast'
      }
    },
    rnn: {
      name: 'Recurrent Neural Networks',
      description: 'Neural networks designed to work with sequential data by maintaining internal state',
      layers: [
        'Input Layer',
        'LSTM/GRU Cells',
        'Hidden State',
        'Output Layer'
      ],
      applications: [
        'Natural Language Processing',
        'Time Series Prediction',
        'Speech Recognition',
        'Machine Translation'
      ],
      frameworks: [
        'TensorFlow',
        'PyTorch',
        'Keras'
      ],
      performance: {
        accuracy: '92%',
        training_time: 'Long',
        inference_speed: 'Medium'
      }
    },
    transformer: {
      name: 'Transformers',
      description: 'Architecture based on self-attention mechanism, revolutionary for sequential data processing',
      layers: [
        'Embedding Layer',
        'Multi-Head Attention',
        'Feed Forward Network',
        'Layer Normalization'
      ],
      applications: [
        'Language Understanding',
        'Text Generation',
        'Code Generation',
        'Vision Transformers'
      ],
      frameworks: [
        'Hugging Face',
        'TensorFlow',
        'PyTorch'
      ],
      performance: {
        accuracy: '98%',
        training_time: 'Very Long',
        inference_speed: 'Fast'
      }
    }
  };

  return (
    <div className="page-container">
      <h1>Deep Learning <span className="glow-text">Research</span></h1>
      <div className="content-wrapper">
        <div className="architecture-selector">
          {Object.keys(architectures).map((archKey) => (
            <button
              key={archKey}
              className={`arch-button ${activeArchitecture === archKey ? 'active' : ''}`}
              onClick={() => setActiveArchitecture(archKey)}
              style={{
                animation: `fadeInDown 0.5s ease-out`
              }}
            >
              {architectures[archKey].name}
            </button>
          ))}
        </div>

        <div className="architecture-content">
          <div className="arch-description">
            <h2>{architectures[activeArchitecture].name}</h2>
            <p>{architectures[activeArchitecture].description}</p>
          </div>

          <div className="content-grid">
            <div className="layers-section">
              <h3>Architecture Layers</h3>
              <div className="layers-flow">
                {architectures[activeArchitecture].layers.map((layer, index) => (
                  <div 
                    key={index}
                    className="layer-card"
                    style={{
                      animation: `fadeInLeft ${0.3 + index * 0.1}s ease-out`
                    }}
                  >
                    {layer}
                    <div className="layer-arrow">â†’</div>
                  </div>
                ))}
              </div>
            </div>

            <div className="applications-frameworks-grid">
              <div className="applications-section">
                <h3>Applications</h3>
                <div className="applications-list">
                  {architectures[activeArchitecture].applications.map((app, index) => (
                    <div 
                      key={index}
                      className="application-item"
                      style={{
                        animation: `fadeInRight ${0.3 + index * 0.1}s ease-out`
                      }}
                    >
                      {app}
                    </div>
                  ))}
                </div>
              </div>

              <div className="frameworks-section">
                <h3>Popular Frameworks</h3>
                <div className="frameworks-list">
                  {architectures[activeArchitecture].frameworks.map((framework, index) => (
                    <div 
                      key={index}
                      className="framework-badge"
                      style={{
                        animation: `fadeInUp ${0.3 + index * 0.1}s ease-out`
                      }}
                    >
                      {framework}
                    </div>
                  ))}
                </div>
              </div>
            </div>

            <div className="performance-section">
              <h3>Performance Metrics</h3>
              <div className="metrics-grid">
                {Object.entries(architectures[activeArchitecture].performance).map(([key, value], index) => (
                  <div 
                    key={key}
                    className="metric-card"
                    style={{
                      animation: `fadeInUp ${0.3 + index * 0.1}s ease-out`
                    }}
                  >
                    <span className="metric-label">{key.replace('_', ' ').toUpperCase()}</span>
                    <span className="metric-value">{value}</span>
                  </div>
                ))}
              </div>
            </div>
          </div>

          <div className="visualization-section">
            {/* Add interactive neural network visualization component here */}
          </div>
        </div>
      </div>
    </div>
  );
}

export default DeepLearning;
